import React from 'react';
import { IonContent, 
  IonHeader, 
  IonPage, 
  IonTitle, 
  IonToolbar,
  IonButton} from '@ionic/react';
import {Plugins} from '@capacitor/core';
import ExploreContainer from '../components/ExploreContainer';
import './Tab1.css';
import {useHistory} from 'react-router-dom'
import {useForm} from 'react-hook-form'

const {Geolocation} = Plugins;
/**
This page should contain:
  -options to take you to other pages:
    -a symptoms checklist 
    -testing sites near you
    -health policies in your area
**/

async function getCurrentPosition() {
  const coordinates = await Geolocation.getCurrentPosition();
  console.log('Current', coordinates);
  return coordinates;
}

const Tab1: React.FC = () => {
  const history = useHistory()
  const {register, handleSubmit} = useForm<any>();
  const onSubmit = ()=> {
    history.push('/Symptoms')
  };

  let coordinates = getCurrentPosition();

  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Location Based COVID-19 Information</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <form onSubmit = {handleSubmit(onSubmit)}>
          <IonButton type="submit">Symptoms Checklist</IonButton>
        </form>
      </IonContent>
    </IonPage>
  );
};

export default Tab1;
